import logging
from datetime import datetime
from enum import Enum, auto
from typing import Dict, List, Optional

# Configure logging
logging.basicConfig(
    level=logging.INFO,
    format='%(asctime)s - %(name)s - %(levelname)s - %(message)s',
    filename='submission_system.log'
)

class PublishStatus(Enum):
    DRAFT = auto()
    VALIDATING = auto()
    VALIDATION_FAILED = auto()
    PUBLISHED = auto()
    FAILED = auto()

class Submission:
    def __init__(self, submission_id: str):
        self.submission_id = submission_id
        self.status = PublishStatus.DRAFT
        self.validation_errors: List[str] = []
        self.fields: Dict[str, str] = {}
        self.file_path: Optional[str] = None
        self.logger = logging.getLogger(f'Submission_{submission_id}')

    def update_publish_status(self, new_status: PublishStatus) -> None:
        self.status = new_status
        self.logger.info(f"Status updated to {new_status.name}")

    def add_validation_error(self, error: str) -> None:
        self.validation_errors.append(error)
        self.logger.warning(f"Validation error added: {error}")

    def get_validation_errors(self) -> List[str]:
        return self.validation_errors

    def add_field(self, key: str, value: str) -> None:
        self.fields[key] = value
        self.logger.info(f"Field added: {key}={value}")

    def upload_file(self, file_path: str) -> None:
        self.file_path = file_path
        self.logger.info(f"File uploaded: {file_path}")

    def validate_file(self) -> bool:
        if not self.file_path:
            self.add_validation_error("No file uploaded")
            return False
        # Basic validation logic (simulated)
        is_valid = "valid" in self.file_path
        if not is_valid:
            self.add_validation_error("Invalid file format or content")
        return is_valid

    def publish(self) -> bool:
        if self.status != PublishStatus.DRAFT:
            self.logger.error("Cannot publish: Submission not in DRAFT status")
            return False
        if not self.validate_file():
            self.update_publish_status(PublishStatus.VALIDATION_FAILED)
            return False
        self.update_publish_status(PublishStatus.PUBLISHED)
        return True

